window.bookSummaryJSON = "<p><b>Cian O'Sullivan</b></p> <p>Gianna Bianchi reminded me of everything I am not—polite and poised. The perfect mafia princess according to old-school standards.</p> <p>She was the type of woman you stayed away from, the kind meant to wed the head of a family.</p> <p>I wanted her. I wanted to possess her. Control her. Most of all, I wanted to love her.</p> <p><b>Gianna Bianchi</b></p> <p>Cian O'Sullivan reminded me of everything I am—possessive and needy.</p> <p>He was the type of man you wrapped your arms around and never let go of, the kind meant to dominate you inside and out.</p> <p>I wanted him. I wanted to be possessed by him. Controlled by him. Most of all, I wanted to love him.</p> <p><i>Sinful Desire </i>is book four in the Mafia Misfits series and can be enjoyed as a standalone. Intended for mature listeners.</p>"; 
